query.query:
query {
  concepts(filter: "id = '1 OR 1=1'") {
    items {
      id
      type
    }
  }
}

query {
  concepts(filter: "uri: https://example.com") {
    items {
      id
      type
    }
  }
}

query {
  concepts(filter: "id: <img src='https://example.com/image.jpg'>") {
    items {
      id
      type
    }
  }
}

query s: concepts {
  s: concepts { id, type }
}

query {
  concepts {
    types {
      name
      fields {
        name
        type {
          kind
        }
      }
    }
  }
}

query {
  concepts {
    items {
      id
      type
      descriptions {
        languageCode
        name
      }
    }
  }
}

query {
  concepts(filter: "uri: https://example.com") {
    items {
      id
      uri
      links {
        targets
      }
    }
  }
}
